export function setRemote(cb) {
	let local = "http://127.0.0.1:9999"
	let gtw = uni.getStorageSync("gtw");
	if (gtw) {
		gtw.push(local);
	} else {
		gtw = [local];
	}
	gtw.reverse();
	let failed = 0
	let all = gtw.length + 1
	getApp().remote = baseHost;
	function tryPing() {
		uni.showLoading();
		for (let i=0;i<gtw.length;i++) {
			let per = gtw[i];
			if(bkhost) {
				break;
			};
			uni.request({
				url: per,
				method: "GET",
				timeout: 3000,
				header: getH({
					host: Encode64(per)
				}),
				success: (res) => {
					if (res.statusCode === 200 && !bkhost) {
						bkhost = per;
						agreementUrl = bkhost + "/user/agreement";
						uni.hideLoading();
						getApp().remote = bkhost
						cb(bkhost);
					}
				},
				fail: (e) => {
					failed++
					console.log("sub node error:", e, "failed", failed);
					if(failed===all) {
						uni.hideLoading();
						uni.showModal({
							title: reqFail,
							content: reqFailDes,
							success: function(res) {}
						});
					}
				}
			})
		}
	};
	uni.request({
		url: baseHost,
		method: "GET",
		timeout: 5000,
		header: getH({
			host: Encode64(baseHost)
		}),
		success: (res) => {
			if (res.statusCode === 200  && !bkhost) {
				bkhost = baseHost;
				uni.hideLoading();
				getApp().remote = bkhost
				cb(bkhost);
			}
		},
		fail: (e) => {
			failed++
			console.log("base error:", e, "failed", failed);
			if(failed===all) {
				uni.hideLoading();
				uni.showModal({
					title: reqFail,
					content: reqFailDes,
					success: function(res) {}
				});
			}
		}
	})
	tryPing();
}

