// 获取请求头
export function getH(params) {
	params["version"] = version;
	params["channel"] = channel;
	params["language"] = navigator.language;
	let sortKeys = Object.keys(params).sort();
	let extra = "";
	for (let key of sortKeys) {
		extra += params[key];
	}
	let h = {};
	h[hd[0]] = "",
		h[hd[1]] = parseInt(new Date().getTime() / 1000),
		h[hd[2]] = randomString(16),
		h[hd[3]] = channel,
		h['content-type'] = 'application/x-www-form-urlencoded'
	//console.log(channel,key,h[hd[2]],h[hd[1]],extra);
	h[hd[0]] = sha256(channel + key + h[hd[2]] + h[hd[1]] + extra);
	h.language = navigator.language;
	let token = uni.getStorageSync("token");
	if (token != "") {
		h.token = token;
		h.tks = sha256(token + h[hd[2]].substring(1));
		h.dk = hex_md5(timeFormat(new Date(), 'yyyy-mm-dd'));
		h.version = version;
		let account = uni.getStorageSync("email");
		if (account) {
			h.email = account;
		}
	}
	return h;
}
export function getRequestObj(url) {
	var theRequest = {};
	let index = url.indexOf("?");
	if (index != -1) {
		var str = url.substr(index + 1);
		let strs = str.split("&");
		for (var i = 0; i < strs.length; i++) {
			theRequest[strs[i].split("=")[0]] = decodeURIComponent(strs[i].split("=")[1]);
		}
	}
	return theRequest;
}

export function getRemoteURL(reqPath,cb) {
	bkhost = baseHost;
	if(getApp().remote) {
		bkhost = getApp().remote;
		if(cb){
			cb()
		}
	}else {
		chrome.runtime.sendMessage({
				type: 14
			},
			function(remote) {
				//console.log("get remote:", remote);
				bkhost = remote;
				getApp().remote = remote;
				if(cb){
					cb()
				}
			});
	}
	return bkhost + reqPath
}

// 发送带签名的请求
export function sendSignReqest(reqPath, m, params, callback, errcall) {
	uni.showLoading();
	getRemoteURL("",function () {
		uni.request({
			url: bkhost + reqPath,
			data: params,
			method: m,
			header: getH(params),
			success: (res) => {
				if (res.statusCode == 200) {
					let bspk = res.header['class'];
					if (bspk) {
						privateKey = Decode64(bspk);
					}
					callback(res.data);
				} else {
					uni.showModal({
						title: reqFail,
						content: reqFailDes,
						success: function(res) {}
					});
				}
			},
			fail: (e) => {
				if (errcall) {
					errcall();
				} else {
					uni.showModal({
						title: reqFail,
						content: reqFailDes,
						success: function(res) {}
					});
				}
			},
			complete() {
				uni.hideLoading();
			}
		});
	})
}

/**
 * 编码base64
 */
export function Encode64(str) {
	return btoa(encodeURIComponent(str).replace(/%([0-9A-F]{2})/g,
		function toSolidBytes(match, p1) {
			return String.fromCharCode('0x' + p1);
		}));
}
/**
 * 解码base64
 */
export function Decode64(str) {
	return decodeURIComponent(atob(str).split('').map(function(c) {
		return '%' + ('00' + c.charCodeAt(0).toString(16)).slice(-2);
	}).join(''));
}


function randomString(len) {
	len = len || 32;
	var $chars = 'ABCDEFGHJKMNPQRSTWXYZabcdefhijkmnprstwxyz02345678oOLl9gqVvUuI1^><|';
	var maxPos = $chars.length;
	var ret = '';
	for (let i = 0; i < len; i++) {
		ret += $chars.charAt(Math.floor(Math.random() * maxPos));
	}
	return ret;
}

/**
 * 时间格式化函数, 按照指定格式化字符串格式化传入时间
 * 
 * @param {Date} time 需要格式化的时间
 * @param {String} fmStr 定义时间的格式
 * 		yyyy: 代表四位数年份
 * 		  yy: 代表两位数年份 
 * 		  mm: 代表月份(小于10时补0)
 * 		  dd: 代表日期(小于10时补0)
 * 		  hh: 代表小时(小于10时补0)
 * 		  hh: 代表小时(小于10时补0)
 * 		  MM: 代表分钟(小于10时补0)
 * 		  ss: 代表秒数(小于10时补0)
 * 		 SSS: 代表毫秒数
 * 		   w: 代表周几(数字) 
 * 		   W: 代表周几(中文) 
 * 		  ww: 代表周几(英文) 
 * @returns {String} 返回格式化的时间
 */
function timeFormat(time, fmStr) {
	const weekCN = '一二三四五六日';
	const weekEN = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'];
	let year = time.getFullYear();
	let month = time.getMonth() + 1;
	let day = time.getDate();
	let hours = time.getHours();
	let minutes = time.getMinutes();
	let seconds = time.getSeconds();
	let milliSeconds = time.getMilliseconds();
	let week = time.getDay();

	month = month >= 10 ? month : ('0' + month);
	day = day >= 10 ? day : ('0' + day);
	hours = hours >= 10 ? hours : ('0' + hours);
	minutes = minutes >= 10 ? minutes : ('0' + minutes);
	seconds = seconds >= 10 ? seconds : ('0' + seconds);

	if (fmStr.indexOf('yyyy') !== -1) {
		fmStr = fmStr.replace('yyyy', year);
	} else {
		fmStr = fmStr.replace('yy', (year + '').slice(2));
	}
	fmStr = fmStr.replace('mm', month);
	fmStr = fmStr.replace('dd', day);
	fmStr = fmStr.replace('hh', hours);
	fmStr = fmStr.replace('MM', minutes);
	fmStr = fmStr.replace('ss', seconds);
	fmStr = fmStr.replace('SSS', milliSeconds);
	fmStr = fmStr.replace('W', weekCN[week - 1]);
	fmStr = fmStr.replace('ww', weekEN[week - 1]);
	fmStr = fmStr.replace('w', week);
	return fmStr;
}

