function extractHostname(a) {
	var b;
	if (a.indexOf("//") > -1) {
		b = a.split("/")[2]
	} else {
		b = a.split("/")[0]
	}
	b = b.split(":")[0];
	b = b.split("?")[0];
	return b
}

export function extractRootDomain(a) {
	var b = extractHostname(a),
		splitArr = b.split('.'),
		arrLen = splitArr.length;
	var c = /^(\d+)\.(\d+)\.(\d+)\.(\d+)$/;
	if (c.test(b)) {
		return b
	}
	if (arrLen > 2) {
		let p3 = splitArr[arrLen - 3];
		if(p3 === "www") {
			b = splitArr[arrLen - 2] + '.' + splitArr[arrLen - 1];
		}else {
			b = p3 + '.' + splitArr[arrLen - 2] + '.' + splitArr[arrLen - 1];
		}
	}
	return b
}
